window.coords = [];
window.ids = 1;

var fillColor = "red";
var fillOpacity = "0.20";
var strokeColor = "blue";
    
    function draw({x,y}){
        const div = document.createElement("div");
        // document.body.appendChild(div);
    
        div.style.position = "absolute";
        div.style.top = y + "px"; 
        div.style.left = x + "px";
        div.style.backgroundColor = "red";
        div.style.width = "5px";
        div.style.height = "5px";
        div.style.borderRadius = "50%";

        document.body.firstChild.appendChild(div);
        console.log("the div", x, y, div.style.top, div.style.left);
        window.coords.push([x,(y - 18)]);
    }

    function handleMouseMove(event) {
        var eventDoc, doc, body;

        event = event || window.event; // IE-ism

        if (event.pageX == null && event.clientX != null) {
            eventDoc = (event.target && event.target.ownerDocument) || document;
            doc = eventDoc.documentElement;
            body = eventDoc.body;

            event.pageX = event.clientX +
               (doc && doc.scrollLeft || body && body.scrollLeft || 0) -
               (doc && doc.clientLeft || body && body.clientLeft || 0);
            event.pageY = event.clientY +
              (doc && doc.scrollTop  || body && body.scrollTop  || 0) -
              (doc && doc.clientTop  || body && body.clientTop  || 0 );
         }
// Use event.pageX / event.pageY here
        if(event.shiftKey)
            draw({ x: event.pageX, y: event.pageY});
    }

    function reset(svgElem){
        document.body.innerHTML = "";
        addButton();
        document.body.appendChild(svgElem);
    }

    function appendSVG(pathStr, svgElem, xmlns){
        var path = document.createElementNS(xmlns, "path");
        path.setAttributeNS(null, "fill", fillColor);
        path.setAttributeNS(null, "fill-opacity", fillOpacity);
        path.setAttributeNS(null, "stroke", strokeColor);
        path.setAttributeNS(null, "d", pathStr);
        path.setAttributeNS(null, "id", window.ids);
        path.setAttributeNS(null, "class", "selections");
        svgElem.appendChild(path);
        window.ids ++;

        reset(svgElem);
    }

    function addButton(){
        var button = document.createElement("button");
        document.body.appendChild(button);
        button.onclick = prepareTrace;
        button.innerHTML = "Prepare Trace";
        button.style.zIndex = 10;
    }

    function createSVG(pathStr){
        var xmlns = "http://www.w3.org/2000/svg";
        if(window.svgElem){
            appendSVG(pathStr, window.svgElem, xmlns);
            return;
        }
        var boxWidth = "660px";
        var boxHeight = "1000px";

        var svgElem = document.createElementNS(xmlns, "svg");
        window.svgElem = svgElem;
        // svgElem.setAttributeNS(null, "viewBox", "0 0 " + boxWidth + " " + boxHeight);
        svgElem.setAttributeNS(null, "width", boxWidth);
        svgElem.setAttributeNS(null, "height", boxHeight);
        svgElem.setAttributeNS(null, "border", "1px solid orange");
        // svgElem.style.display = "block";

        var path = document.createElementNS(xmlns, "path");
        path.setAttributeNS(null, "fill", fillColor);
        path.setAttributeNS(null, "fill-opacity", fillOpacity);
        path.setAttributeNS(null, "stroke", strokeColor);
        path.setAttributeNS(null, "d", pathStr);
        path.setAttributeNS(null, "id", window.ids);
        path.setAttributeNS(null, "class", "selections");
        svgElem.appendChild(path);
        window.ids ++;

        console.log(svgElem);
        
        reset(svgElem);
    }

    function prepareTrace(){
        var firstArr = [];

        window.coords.forEach((item)=>{
            var set = item.join(" ");
            firstArr.push("L " + set);
        });

        var line = firstArr.join(" ");
        var char = line[0];
        line = line.replace(char, 'M');
        console.log(line + " Z");
        var path = line + " Z";
        window.coords = [];
        // document.body.innerHTML = "";
        createSVG(path)
    }

    function prepareCanvas(){
        document.body.innerHTML = "";
//        document.body.style.backgroundImage = "url(data:image/jpeg;base64,)";
        document.body.style.backgroundRepeat= "no-repeat";
        document.body.style.height = "1000px";
        document.body.style.width = "660px";
        // document.body.style.backgroundColor = "white";
        
        var groupDiv = document.createElement("div");
        groupDiv.classList.add("group");
        document.body.appendChild(groupDiv);
        var position = document.onmousemove = handleMouseMove;
        

        addButton();
    }
    prepareCanvas();

